import { getUserData } from "../../services/fetchUser";
import { setUserInfo } from "./reducers";

export const setUserInfoThunk = () => {
  const data = getUserData("mojombo");
  const userInfoPropertis = new Map([
    ["login", data.login],
    ["email", data.email],
    ["company", data.company],
    ["avatar_url", data.avatar_url],
    ["repos_url", data.repos_url],
    ["blog", data.blog],
  ]);
  return setUserInfo(userInfoPropertis);
};
